import '../Styles/Footer.css';

export default function Footer(){
    return (
        <footer className='Footer'>

            <img src={require('../Images/Footer/BOFA-logo-white.png')} alt='bank of america logo' />

            <nav>
                <ul>
                    <li>Resources</li>
                    <li>Mentorships</li>
                    <li>About Us</li>
                </ul>
            </nav>

            <div className='socials-container'>
                {/* social media icons here */}
            </div>
        </footer>
    );
}
